import React from "react"

function Joke(props){

    return(
        <div>
            <h3 style={{display :props.question && "none"}}>Question: {props.question}</h3>
            <h3 style={{display: props.answer ? "block" : "none"}}>Answer: {props.answer}</h3>
            <hr/>
        </div>
    )
}

export default Joke
